import React, {Component} from 'react';
import  './SearchingForm.css';



class SearchingForm extends Component {
    render() {
        return (
            <form className="form">
                <input className="input" type="text"  name="From" placeholder="From" />
                <input className="input" type="text"  name="To" placeholder="To" />
                <input className="input" type="text"  name="Departure data" placeholder="Departure date" />
                <input className="input" type="text"  name="Arrival data" placeholder="Arrival date" />
                <input type="submit" value="Submit" className="btn"/>
            </form>
        )
    }
}

export default SearchingForm;
